import React from "react";
import "./App.css";
import Header from "./components/Header";
import Main from "./components/Main";

const App = () => {
  const [books, setBooks] = useState([]);

  const getBooks = (books) => {
    setBooks(books);
  };

  return (
    <div>
      <Header getBooks={getBooks} />
      <Main books={books} />
    </div>
  );
};

export default App;
